// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

/**
* @title Rich Title - Romance of the Three Kingdoms Title NFT
*
*
* Docs: 
*
* Version v1.1.0
*
*/

contract RichTitle is ERC1155, AccessControl {
    using SafeMath for uint256;

    bytes32 public constant MINT_ROLE = keccak256("MINT");

    uint256 public constant PCT_BASE = 1e18;

    struct TitleDetail {
        uint256 tokenId; //  ID
        bytes32 name; // 
        uint64 getTime; // 
        uint64 getWay; // 0:PVE 
        uint64 quality; //  0: 1: 2: 3:
        uint64 property; // 0: 1: 2: 3: 4:
        uint64 addition; // 
    }

    uint256 public tokenListLength;

    mapping (uint256 => TitleDetail) public _titles;
    mapping (address => uint256) public _wears;
    mapping (address => bool) public _isWears;

    event NewTitle(uint256 tokenId, bytes32 name, address owner);

    constructor() ERC1155 ("Rich Title") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    function addTitle(bytes32 name, uint64[] memory detail) public onlyRole(MINT_ROLE) returns (uint256) {
        uint256 tokenId = tokenListLength++;
        _titles[tokenId] = TitleDetail(
            tokenId, 
            name,
            uint64(block.timestamp),
            detail[0], 
            detail[1],
            detail[2],
            detail[3]
        );
        return tokenId;
    }

    function mint(
        address account, uint256 tokenId
    ) public onlyRole(MINT_ROLE) {
        require(tokenId < tokenListLength);
        _mint(account, tokenId, 1, "");
        emit NewTitle(tokenId, _titles[tokenId].name, account);
    }

    function getNowTitle(address who) public view returns (TitleDetail memory detail) {
        if (_isWears[who]) {
            return _titles[_wears[who]];
        } 
    }

    function getAllTitles() public view returns (TitleDetail[] memory) {
        uint256 len = tokenListLength;
        TitleDetail[] memory list = new TitleDetail[](len);
        for (uint256 i = 0; i < len; i++) {
            list[i] = _titles[i];
        }
        return list;
    }

    function titleList(address account) public view returns (TitleDetail[] memory) {
        uint256 len = tokenListLength;
        TitleDetail[] memory list = new TitleDetail[](len);
        uint256 resultLen;
        for (uint256 i = 0; i < len; i++) {
            if (balanceOf(account, i) > 0) {
                list[resultLen++] = _titles[i];
            }
        }
        TitleDetail[] memory result = new TitleDetail[](resultLen);
        for (uint256 i = 0; i < resultLen; i++) {
            result[i] = list[i];
        }
        return result;
    }

    function wear(uint256 tokenId) public {
        require(balanceOf(msg.sender, tokenId) > 0, "Only Owner");
        _wears[msg.sender] = tokenId;
        if (!_isWears[msg.sender]) {
            _isWears[msg.sender] = true;
        }
    }

    function detach() public {
        require(_isWears[msg.sender]);
        _wears[msg.sender] = 0;
        _isWears[msg.sender] = false;
    }

    function supportsInterface(bytes4 interfaceId) public view virtual
        override(ERC1155, AccessControl) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

